  false,\n\t\"url\": null,\n\t\"notes\": \"Current components, pressure, and other
  data were collected from moored current meters and pressure gauges from FIXED PLATFORMS
  in the Greenland and Beaufort Seas. Data were collected by the Pacific Marine Environmental
  Laboratory (PMEL) from 28 March 1987 to 01 June 1988. Data has been processed by
  NODC to the standard NODC F005-Current Meter Data and the F017-Pressure Gauge Data
  formats. Full format and format code descriptions are available at http://www.nodc.noaa.gov/General/NODC-datafmts.html.nnThis
  F015 format is used for time series measurements of ocean currents. These data are
  obtained from current meter moorings and represent Eulerian method of current measurement,
  i.e., the meters are deployed at a fixed point and measure flow past a sensor. Position,
  bottom depth, sensor depth, and meter characteristics are reported for each station.
  The data record comprises values of east-west (u) and north-south (v) current vector
  components at specified date and time. Current direction is defined as the direction
  toward which the water is flowing with positive directions east and north and negative
  directions west and south. Data values may be subject to averaging or filtering
  and are typically reported at 10-15 minute time intervals. Water temperature, pressure,
  and conductivity or salinity may also be reported. A text record is available for
  optional comments.nnThe F017 format contains time series measurements of seawater
  pressure from anchored or bottom-mounted sensors. Measurements of variations at
  depth of seawater pressure provide information on tidal and storm flows, ocean circulation,
  and other phenomena that cause changes in sea surface elevation or slope and that
  can be detected from their pressure signature. Position, bottom depth, and gauge
  depth are reported for each station. The data record comprises values of total pressure
  at specified date and time. Data values may be subject to averaging or filtering
  and are typically reported at time intervals of 10-15 minutes. Seawater temperature
  may also be reported. Comments may be reported in a text record.\",\n\t\"owner_org\":
